class Solution:
    def count(self, num1: str, num2: str, min_sum: int, max_sum: int) -> int:
        MOD = 10**9 + 7
        memo = {}

        def dp(i, tight, total):
            if i == len(num2): return min_sum <= total <= max_sum
            if not tight and (i, total) in memo: return memo[(i, total)]
            limit = int(num2[i]) if tight else 9
            res = 0
            for digit in range(0, limit + 1):
                new_tight = tight and (digit == int(num2[i]))
                res += dp(i + 1, new_tight, total + digit)
            if not tight: memo[(i, total)] = res
            return res % MOD

        def count_less_than(x):
            str_x = str(x)
            res = 0
            for i in range(1, len(str_x)):
                for j in range(1, 10):
                    res += dp(1, i == len(str_x) - 1 and j == int(str_x[0]), j)
            total = 0
            for i, c in enumerate(str_x):
                for digit in range(0, int(c) + (i == len(str_x) - 1)):
                    if i == 0 and digit == 0: continue
                    res += dp(i + 1, digit == int(c), total + digit)
                total += int(c)
            if min_sum <= total <= max_sum: res += 1
            return res % MOD

        return (count_less_than(int(num2) + 1) - count_less_than(int(num1))) % MOD
